import React, { useState } from "react";

function FilterByTicketNumber({ data }) {
  const [val, SetVal] = useState("");
  const [Filtered, setFiltered] = useState(data);
  const HandelSearch = (E) => {
    SetVal(E.target.value);
    {
      data === null && <h3>no data</h3>;
    }
    const FilterTkt =
      data &&
      data.filter((v) => {
        return parseInt(v.TicketNumber.includes(parseInt(val)));
      });
    setFiltered(FilterTkt);
  };
  return (
    <div>
      <input type="search" value={val} onChange={HandelSearch} />
      {console.log(Filtered)}
    </div>
  );
}

export default FilterByTicketNumber;
